import React from "react";
import { Typography, TextField, Button, Grid } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(() => ({
	root: {
		margin: "0 auto",
		width: "100%",
	},
	form: {
		margin: "30px 0",
	},
	textField: {
		display: "block",
		width: "100%",
		// backgroundColor: "lightgray",
		borderRadius: "5px 5px 0 0",
		margin: "10px 0",
	},
	button: {
		float: "right",
	},
}));

const SignUpPage = () => {
	const classes = useStyles();

	return (
		<div className={classes.root}>
			<Grid container spacing={3}>
				<Grid item xs={12} md={6}>
					<Typography variant="h4">Sign Up</Typography>
					<form className={classes.form}>
						<TextField
							className={classes.textField}
							required
							id="firstName"
							label="First Name"
							fullWidth
							variant="outlined"
						/>
						<TextField
							className={classes.textField}
							required
							id="lastName"
							label="Last Name"
							fullWidth
							variant="outlined"
						/>
						<TextField
							className={classes.textField}
							required
							id="username"
							label="Username"
							fullWidth
							variant="outlined"
						/>
						<TextField
							className={classes.textField}
							required
							id="email"
							label="Email"
							type="email"
							fullWidth
							variant="outlined"
						/>
						<TextField
							className={classes.textField}
							required
							id="password"
							label="Password"
							type="password"
							fullWidth
							variant="outlined"
						/>
						<Button className={classes.button}>Submit</Button>
					</form>
				</Grid>
				<Grid item xs={12} md={6}>
					<div></div>
				</Grid>
			</Grid>
		</div>
	);
};

export default SignUpPage;
